import React, { Component } from 'react';
import Carousel from '@brainhubeu/react-carousel';
import '@brainhubeu/react-carousel/lib/style.css';


export default class MyCarousel extends Component {
  render() {
    return (
      <Carousel>
        <img src= "./img/imageOne.png" alt="description of image"/>
        <img src= "./img/imageTwo.JPG" alt="description of image"/>
        <img src= "./img/imageThree.png" alt="description of image"/>
      </Carousel>
    );
  }
}
